    true,nt"url": null,nt"notes": "These rates are commonly referred to as
    Constant Maturity Treasury rates, or CMTs. Yields are interpolated by the Treasury
    from the daily yield curve. This curve, which relates the yield on a security to
    its time to maturity is based on the closing market bid yields on actively traded
    Treasury securities in the over-the-counter market. These market yields are calculated
    from composites of quotations obtained by the Federal Reserve Bank of New York.
    The yield values are read from the yield curve at fixed maturities, currently 1,
    3 and 6 months and 1, 2, 3, 5, 7, 10, 20, and 30 years. This method provides a yield
    for a 10 year maturity, for example, even if no outstanding security has exactly
    10 years remaining to maturity.",nt"license_title": "Creative Commons CCZero",nt"extras":
